Elde veya bulaşık makinesinde yıkanabilir. 5 dakika kaynatılarak ya da Mamajoo sterilizatörleri ile steril edilebilir. Ürünün ömrünü kısaltmamak için aşındırıcı deterjan kullanmaktan kaçınınız ve belirli aralıklarla biberonları, düzenli aralıklarla biberon emziğini değiştiriniz.

